import './Tags.css'
import TagItem from "../TagItem/TagItem";
import { useEffect } from 'react';

const Tags = ({ title, tags }) => {

    useEffect(() => {
        console.log(tags)
    })

    return ( 
        <div className="tags">
            {tags && <h2>{title}</h2>}
            <div className="tag-list">
                {tags && tags.map(tag => <TagItem tagName={tag.type.name} />)}
            </div>
        </div>
    );
}

export default Tags;
